import React, { useEffect, useState } from "react";
import PromiseExampleHome from "./ApiExample/ApiIntigrationHome";
import axios from "axios";

const ExampleWithPromises = () => {
    const [state, setState] = useState({
        Promise1Data:[],
    });

    useEffect(() => {
        const fetchData = async () => {
            try {
                const [Promise1, Promise2, Promise3, Promise4, Promise5,] = await Promise.all([
                    axios.get('https://jsonplaceholder.typicode.com/users')
                ]);
                const dataResults = Promise1.data;
                
                console.log("dataResults", dataResults);
            } catch (error) {
                console.error("Error");
            }
        };
        fetchData();
    }, []);

    return (
        <>
            <PromiseExampleHome />
        </>
    )
}
export default ExampleWithPromises;
